const Task = ({ description, completed, created,  }) => {
    return(
        <li className={completed ? "completed" : ""}>
          <div className="view">
            <input className="toggle" type="checkbox" checked={completed} sds={2}></input>
            <label>
              <span className="description">{description}</span>
              <span className="created">{created}</span>
            </label>
            <button className="icon icon-edit">edit</button>
            <button className="icon icon-destroy">delete</button>
          </div>
      </li>
    )
}

export default Task;
